import React from "react";
import { Link } from "react-router-dom";

function PlacesPage() {
  return (
    <div className="container">
      <h3>Accommodation</h3>
      <Link to="/account" className="btn btn-primary">
        &plus, Add new place
      </Link>
    </div>
  );
}

export default PlacesPage;
